social_posts.post_text:
@chynna_weierstall will be joining Winterclash in 2024 for the first time ever. For several years we have been trying to make it happen but somehow it never worked out. That's why we are all the happier that one of the very best riders of our time finally will be in Eindhoven with us.   The riders registration is still open and we are updating the list once a week with new Junior and Amateur riders. In early January we are going to reveal the first big list of pro riders and we can already tell you that the list is going to be something special again.  If you haven’t signed up already, you can do so on our website.  78 days to go! 💙

📷 @brianlewis.photo 

#winterclash #winterclash2024 #wearewinterclash

